import React, { Component } from 'react';

import { withFirebase } from '../Firebase'

class SignOutButton extends Component{
    constructor(props) {
        super(props)
    }

    onSignOut(firebase) {
        let result = this.props.firebase.doSignOut
        return result
    }   

    render() {
        return(
            <button type="button" onClick={this.onSignOut(this.props.firebase)}>
                Sign Out
            </button>
        )
    }
}

export default withFirebase(SignOutButton)
